import React, { useState } from "react";
import ResumeList from "../components/ResumeList";
import { resumes } from "../dummyData/resumes";

function ResumePage() {
  return (
    <div>
      <h1>Resume Page</h1>
      <ResumeList resumes={resumes} />
    </div>
  );
}

export default ResumePage;
